import lxml
import json
import random

import pandas as pd
import requests

res = requests.get('https://api.hearthstonejson.com/v1/45932/enUS/cards.json')
raw_content = res.content.decode()
json_content = json.loads(raw_content)
df_cards = pd.DataFrame(json_content)

df_cards_compressed = (df_cards[(df_cards.type == 'MINION') & (df_cards.collectible == True)]
                               [['name', 'attack', 'health']]
                               .astype({'attack': int, 'health': int}))

df_cards_compressed['mapping_key'] = df_cards_compressed.apply(lambda x: ''.join(map(str, x.values[1:])), axis=1)



res = requests.get('https://raw.githubusercontent.com/HearthSim/hsdata/master/CardDefs.xml')
root = lxml.etree.fromstring(res.content)

kor = root.xpath('/CardDefs/Entity[./Tag[@name="CARDTYPE" and @value="4"]]/Tag[@name="CARDNAME"]/koKR/text()')
eng = root.xpath('/CardDefs/Entity[./Tag[@name="CARDTYPE" and @value="4"]]/Tag[@name="CARDNAME"]/enUS/text()')

translates = {k: v.replace(' ', '') for k, v in zip(eng, kor)}
df_cards_compressed['mapping_value'] = df_cards_compressed.name.apply(lambda x: translates[x])

mapping = {kv[0]: kv[1].values[0] for kv in df_cards_compressed.groupby('mapping_key').agg({'mapping_value': set}).iterrows()}

def sample_minion_anyhow(key):
    try:
        return random.sample(mapping[key], 1)[0]
    except KeyError:
        try:
            return random.sample(mapping[key[::-1]], 1)[0][::-1]
        except KeyError:
            if   key == '92': return '오아시스무쇠턱거북이신의보호막맞고발라당맞음'
            elif key == '89': return '황제문어처치한세린'
            elif key == '98': return '황제문어처치한세린발라당맞음'
            elif key == '80': return '천정발라당맞은초'
            elif key == '08': return '천정발라당맞은초'[::-1]
            elif key == '19': return '신보발라당맞은리븐데어'
            elif key == '29': return '내분맞은탈옥한공포수호병'
            elif key == '91': return '발라당신보맞은모구샨감시자'
            elif key == '00': return '기습기습'
            else: raise KeyError('AH')
           
           
